import React from "react";
import S from "./Card.module.css";

function Card({ breeds }) {
  return (
    <div>
      {breeds.map((e) => {
        return (
          <div>
            <h1>{e.name}</h1>
          </div>
        );
      })}
    </div>
  );
}
export default Card;
